            <div>
                <h2 class=\"mt-6 text-center text-3xl font-extrabold text-gray-900\">
                    Connexion :)
                </h2>
                {% if error %}
                    <p class=\"mt-2 text-center text-sm text-gray-600\">
                        {{ error.messageKey|trans(error.messageData, 'security') }}
                    </p>
                {% endif %}
            </div>
            <form class=\"mt-8 space-y-6\" method=\"POST\">
                <div class=\"rounded-md shadow-sm -space-y-px\">
                    <div>
                        <label for=\"email-address\" class=\"sr-only\">Username</label>
                        <input type=\"text\" required autofocus class=\"appearance-none rounded-none relative block w-full px-3 py-2 border border-gray-300 placeholder-gray-500 text-gray-900 rounded-t-md focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 focus:z-10 sm:text-sm\" placeholder=\"Username\" value=\"{{ last_username }}\" name=\"username\" id=\"inputUsername\">
                    </div>
                    <div>
                        <label for=\"password\" class=\"sr-only\">Password</label>
                        <input id=\"inputPassword\" name=\"password\" type=\"password\" required class=\"appearance-none rounded-none relative block w-full px-3 py-2 border border-gray-300 placeholder-gray-500 text-gray-900 rounded-b-md focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 focus:z-10 sm:text-sm\" placeholder=\"Password\">
                    </div>
                </div>
                <div>
                    <button type=\"submit\" class=\"group relative w-full flex justify-center py-2 px-4 border border-transparent text-sm font-medium rounded-md text-white bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500\">
                        <span class=\"absolute left-0 inset-y-0 flex items-center pl-3\">
                        <!-- Heroicon name: lock-closed -->
                            <svg class=\"h-5 w-5 text-indigo-500 group-hover:text-indigo-400\" xmlns=\"http://www.w3.org/2000/svg\" viewBox=\"0 0 20 20\" fill=\"currentColor\" aria-hidden=\"true\">
                              <path fill-rule=\"evenodd\" d=\"M5 9V7a5 5 0 0110 0v2a2 2 0 012 2v5a2 2 0 01-2 2H5a2 2 0 01-2-2v-5a2 2 0 012-2zm8-2v2H7V7a3 3 0 016 0z\" clip-rule=\"evenodd\" />
